import React from "react";
import { useSelector } from "react-redux";

export const Information = () => {
  const allAstronauts = useSelector((store) => store.astronauts.all);
  console.log(allAstronauts);
  return <div>{allAstronauts.map((astronaut) => astronaut.name)}</div>;
};
